import "./widget1.css"
import AreaChart from './area charts/Area Chart';
import Titre1 from './Titre1/titre1';
import Comment1 from './Comment1/comment1';


class Widget1 extends Component{

    render(){

        const { titre1, comment1 } = this.props.data1 ; 
        return(
            <div className="cont1">
            <Titre1 titre1={titre1}/>
            <Comment1 comment1={comment1}/>
            <AreaChart />
          </div>
        );
    }



}


export default Widget1;
